import React, { Component } from 'react'

export default class Repositories extends Component {

    constructor(props){
        super(props);
        var repositories
        let repos

        this.state = {
            repos: localStorage.getItem('@Trinity/repositories'),
            repository: new Array(repos)

        }
        console.log(repos)
    }


    FetchRepositories(){
        for (let i = 0; i < this.state.repositories; i++) {
            this.state.repos[i] = localStorage.getItem(`@Trinity/repo${i}`);
            console.log(this.state.repos[i]);
        }
    }

    render() {
        return (
            <div>
                {this.state.repository.map( repository =>(

                    <div key={repository.id}>
                        <div>
                            <h1>
                                {repository.name}
                            </h1>
                        </div>
                        <div>
                            {repository.forks}
                        </div>
                    </div>
                ))}
            </div>
        )
    }
}
